<style>
    :root {

        color: var(--brand-experiment);
        text-decoration: none;
    }

    .attachment-link:hover {
        text-decoration: underline;
    }

        margin-top: 8px;
        border-radius: 4px;
        display: flex;
        flex-direction: column;

        color: var(--text-normal);
        margin-bottom: 8px;
    }

    .embed-description {
        color: var(--text-normal);
        font-size: 14px;
    }

        color: var(--text-normal);
        font-size: 14px;
    }

    .embed-field-value {
        color: var(--text-normal);
        font-size: 14px;
    }

    .embed-footer {
        font-size: 12px;
        color: var(--text-muted);
        margin-top: 8px;
    }

    .system-message {
        color: var(--text-muted);
        font-size: 14px;
        text-align: center;
        margin: 16px 0;
    }

    pre {

        font-size: 14px;
        margin: 8px 0;
        overflow-x: auto;
